import React from "react";

const Features = () => {
  return (
    <section className="features">
      <div className="container">
        <h2>What Makes Us Different</h2>
        <div className="features-grid">
          <div className="feature-card">
            <h3>Focused on Cause-Driven Partnerships</h3>
            <p>Connect with organizations that share your values</p>
          </div>
          <div className="feature-card">
            <h3>Advanced Matching Algorithm</h3>
            <p>Find the perfect partners for your mission</p>
          </div>
          <div className="feature-card">
            <h3>Transparent Collaboration</h3>
            <p>Clear communication and shared goals</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Features;
